import React from "react";
import { Col, Row } from "antd";
import Product from "../product/product";

const Products = () => {
  return (
    <Row>
      <Col span={6}><Product /></Col>
      <Col span={6}><Product /></Col>
      <Col span={6}><Product /></Col>
      <Col span={6}><Product /></Col>
    </Row>
  );
};

export default Products;
